import logo from './logo.svg';
import './App.css';
import Heroe from './components/Herobox'

const App = () => {
  return (
    <div className="App">
      <Heroe name="Erik Rodriguez" heroName="Iron Man"/>
      <Heroe name="Manolo Rodriguez" heroName="Thor"/>
      <Heroe name="Pepito" heroName="Programador"/>
    </div>
  );
}

export default App;
